import {
    makeStyles
} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    root: {
        position: 'fixed',

    },
    item:{
        //backgroundColor:"#014034",
        textAlign:"center",
        marginLeft:"auto", 
        marginRight:"auto",
        color:"white",
        height:"60px",
        justifyContent: 'center',
        alignItems: 'center'
    },
    containter:{
        backgroundColor:"red",
    }
}));

export default useStyles;
